import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';
import Loginpage from './components/Loginpage';

function App() {
  return (
    <div>
      <Header/>
      <Router>
        <Routes>
          <Route path="/" element={<Loginpage />} />
        </Routes>
      </Router>
      <Footer/>
    </div>
  );
}

export default App;
